import React , { useEffect } from 'react';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import NavigationBar  from './components/NavigationBar';
import WelcomePanel from './components/WelcomePanel';
import Airports from './components/Airports';
import Routes from './components/Routes';
import Popularity from './components/Popularity'


function App() {

  return (
    <div >
    <React.Fragment>
      <Router>
      <NavigationBar />
        <Switch>
          <Route exact path="/" component={WelcomePanel} />
          <Route exact path="/airports" component={Airports} />
          <Route exact path="/routes" component={Routes} />
          <Route exact path="/popularity" component={Popularity} />
          {/* <Route exact path="/calculating" render={(props) => <Calculating {...props} projectName={props.location.state} />}></Route> */}
        </Switch>
      </Router>
    </React.Fragment>
    </div>
  );
}

export default App;
